import { Typography,Grid, TextField} from '@mui/material';
import { Box } from '@mui/system';
import React from 'react';

function Todo(props) {
    return (
        <div>
            <Grid container>
                 <Grid sx={{border:"1px solid " ,margin:"auto"}} item xs = {1} sm = {12} md = {6} lg = {6} xl ={6}>
                    <Box>
                        <Typography>Add A Task</Typography>
                    </Box>
                    <Box>
                          <Typography variant ="h5">Add A Task</Typography>
                          <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                          <Typography variant ="body1">Enter what you want to submits</Typography>
                    </Box>


                 </Grid>
            </Grid>
        </div>
    );
}

export default Todo;
